import { createRouter, createWebHashHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import NovoFornecedor from '../components/Fornecedor/NovoFornecedor.vue'
import FornecedorIndex from '../views/Fornecedor/FornecedorIndex.vue'
import Login from '../views/Usuario/Login.vue'
import DefaultLayout from '../layouts/Default.vue'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/fornecedores',
    name: 'layout',
    meta: Vue.component( 'Layout', require( './pages/Layout.vue' ) ),
    children: [
      {
          path: '/',
          name: 'home',
          component: Vue.component( 'Home', require( './pages/Home.vue' ) )
      },
    ]
  },
  { 
    path: '/fornecedores/cadastro',
    name: 'Fornecedores-cadastro',
    component: NovoFornecedor,
  },
  {
    path: '/fornecedores',
    name: 'Fornecedores',
    component: FornecedorIndex,
  },
  {
    path: '/login',
    name: 'login',
    component: Login,
  }
]
routes: [
  {
      path: '/',
      name: 'layout',
      component: Vue.component( 'Layout', require( './pages/Layout.vue' ) ),
      children: [
          {
              path: 'home',
              name: 'home',
              component: Vue.component( 'Home', require( './pages/Home.vue' ) )
          },
          {
              path: 'cafes',
              name: 'cafes',
              component: Vue.component( 'Cafes', require( './pages/Cafes.vue' ) ),
          },
          {
              path: 'cafes/new',
              name: 'newcafe',
              component: Vue.component( 'NewCafe', require( './pages/NewCafe.vue' ) )
          },
          {
              path: 'cafes/:id',
              name: 'cafe',
              component: Vue.component( 'Cafe', require( './pages/Cafe.vue' ) )
          }
      ]
  }
]
const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
